import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 24.2-952.4 Filing schedule for inaugural committees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-952.4.md","filePath":"vacode/24.2-952.4.md"}'),i={name:"vacode/24.2-952.4.md"},o=r('<h1 id="§-24-2-952-4-filing-schedule-for-inaugural-committees" tabindex="-1">§ 24.2-952.4 Filing schedule for inaugural committees. <a class="header-anchor" href="#§-24-2-952-4-filing-schedule-for-inaugural-committees" aria-label="Permalink to &quot;§ 24.2-952.4 Filing schedule for inaugural committees.&quot;">​</a></h1><p>An inaugural committee shall file the prescribed reports of contributions and expenditures as follows:</p><ol><li><p>Not later than March 15 immediately following the inauguration for all contributions and expenditures made prior to the preceding March 1;</p></li><li><p>Not later than July 15 of the inauguration year complete through June 30;</p></li><li><p>Not later than the following January 15 complete through December 31; and</p></li><li><p>Not later than January 15 complete through December 31 and annually thereafter until a final report is filed.</p></li></ol><p>1991, cc. 474, 709, §§ 24.1-254.3, 24.1-924; 1993, c. 641, §§ 24.2-913, 24.2-924; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0787" target="_blank" rel="noreferrer">787</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0892" target="_blank" rel="noreferrer">892</a>.</p>',4),l=[o];function n(c,s,u,h,p,d){return t(),a("div",null,l)}const g=e(i,[["render",n]]);export{_ as __pageData,g as default};
